";s:23:\"wphr-attendance-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:11;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"1314\";s:11:\"description\";s:253:\"Enable employees to check in and out, accurately recording their working hours.  The system works directly from the employee\'s profile dashboard or you can import data in CSV format from other apps.  Admins can set office hours and add unlimited shifts.\";s:17:\"short_description\";s:38:\"Track and monitor employee attendance.\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/1314/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/1314/card_banner.png\";s:15:\"selling_point_0\";s:65:\"Enable employees to check in and out - record their working hours\";s:15:\"selling_point_1\";s:31:\"Specify office hours and shifts\";s:15:\"selling_point_2\";s:50:\"View reports on attendance with WP--HR Manager Pro\";s:11:\"screenshots\";N;s:2:\"id\";s:2:\"89\";s:7:\"updated\";s:19:\"2018-12-28 14:31:32\";s:7:\"created\";s:19:\"2017-08-22 20:51:23\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_287705a8d62f3d9852ecdfb47e88d\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"1314\";s:7:\"updated\";s:19:\"2020-10-21 14:42:35\";s:7:\"created\";s:19:\"2017-08-22 19:59:27\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:2;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"1296\";s:5:\"title\";s:15:\"WP-HR Documents\";s:4:\"slug\";s:14:\"wphr-documents\";s:12:\"premium_slug\";s:22:\"wphr-documents-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:3;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"2446\";s:11:\"description\";s:759:\"If you need to create a library of files and documents for all employees or simply add a document for a single employee this plugin delivers.  You can create a library, add folders to help manage and locate documents of particular types - for example, add you Health and Safety guidelines in one folder, and your Employee Handbook in another.  You can also add documents to individual employee profiles, for example, a copy of their employment contract.  Finally, employees themselves can upload documents directly so if you need a copy of their ID or drivers licence, for example, you could ask them to add them directly to their profile in the new \'Documents\' section created by this plugin.  You can upload most formats - PDF, Word, Excel, image files etc.\";s:17:\"short_description\";s:57:\"Upload and manage HR files and documents in WP-HR Manager\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2446/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2446/card_banner.png\";s:15:\"selling_point_0\";s:42:\"Create a library of HR Documents and Files\";s:15:\"selling_point_1\";s:43:\"Add Folders to Easily Manage your Documents\";s:15:\"selling_point_2\";s:48:\"Upload Documents to Individual Employee Profiles\";s:11:\"screenshots\";N;s:2:\"id\";s:3:\"377\";s:7:\"updated\";s:19:\"2018-08-18 12:30:18\";s:7:\"created\";s:19:\"2018-08-15 14:47:18\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_4c0d0646a94caa7b6d66d2a515b07\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"2446\";s:7:\"updated\";s:19:\"2020-10-24 22:10:03\";s:7:\"created\";s:19:\"2018-08-15 11:28:31\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:3;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"1296\";s:5:\"title\";s:16:\"WP-HR Add Fields\";s:4:\"slug\";s:11:\"wphr-fields\";s:12:\"premium_slug\";s:19:\"wphr-fields-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:5;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"2454\";s:11:\"description\";s:257:\"There are already a lot of useful fields in WP-HR Manager for recording employee information - but you may want more!   Now you can easily add many types of field to the employee\'s profile, enabling you to gather and manage exactly the information you need.\";s:17:\"short_description\";s:31:\"Add fields to Employee Profiles\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2454/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2454/card_banner.png\";s:15:\"selling_point_0\";s:31:\"Add fields to employee profiles\";s:15:\"selling_point_1\";s:53:\"Multiple field types - text, drop down, tick box etc.\";s:15:\"selling_point_2\";s:39:\"Collect additional employee information\";s:11:\"screenshots\";N;s:2:\"id\";s:3:\"379\";s:7:\"updated\";s:19:\"2018-08-21 19:28:21\";s:7:\"created\";s:19:\"2018-08-18 14:39:32\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_9aa3fe478e0a0b4092a8d046330a5\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"2454\";s:7:\"updated\";s:19:\"2020-10-23 11:51:48\";s:7:\"created\";s:19:\"2018-08-18 14:07:53\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:4;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"1296\";s:5:\"title\";s:18:\"WP-HR SMS Messages\";s:4:\"slug\";s:8:\"wphr-sms\";s:12:\"premium_slug\";s:16:\"wphr-sms-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:4;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"2455\";s:11:\"description\";s:230:\"It\'s good to keep in touch with employees and SMS messages are now one of the most common means of communicating in the world - so why not integrate an SMS messaging service with WP-HR Manager to help your employee communications?\";s:17:\"short_description\";s:31:\"Keep in touch with SMS messages\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2455/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2455/card_banner.png\";s:15:\"selling_point_0\";s:26:\"SMS message your employees\";s:15:\"selling_point_1\";s:38:\"Integrates with multiple SMS suppliers\";s:15:\"selling_point_2\";N;s:11:\"screenshots\";N;s:2:\"id\";s:3:\"378\";s:7:\"updated\";s:19:\"2018-08-18 14:45:53\";s:7:\"created\";s:19:\"2018-08-18 14:31:46\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_ad12da38db8bce4fd2c753d932e51\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"2455\";s:7:\"updated\";s:19:\"2020-07-29 09:29:43\";s:7:\"created\";s:19:\"2018-08-18 14:14:31\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:5;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"1296\";s:5:\"title\";s:21:\"WP-HR Mobile Check In\";s:4:\"slug\";s:12:\"wphr-checkin\";s:12:\"premium_slug\";s:20:\"wphr-checkin-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:0;s:22:\"premium_releases_count\";i:6;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"2702\";s:11:\"description\";s:419:\"The addon works with WP-HR Manager and WP-HR Attendance to add the functionality to integrate our two (Apple and Android) phone apps.  Perfect for employees who don\'t have regular access to a PC, or who work remotely.  Ask them to check in when the start work and check out when they finish - you\'ll know who is working at any time.  Ideal for tracking lateness, over time, remote workers, time based projects and more.\";s:17:\"short_description\";s:55:\"Enable employees to check in/out on their mobile phones\";s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2702/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/2702/card_banner.png\";s:15:\"selling_point_0\";s:45:\"One tap check in and check out (clock in/out)\";s:15:\"selling_point_1\";s:31:\"Andoid and Apple Apps available\";s:15:\"selling_point_2\";s:41:\"Perfect for tracking lateness and absence\";s:11:\"screenshots\";N;s:2:\"id\";s:3:\"436\";s:7:\"updated\";s:19:\"2018-10-26 12:32:42\";s:7:\"created\";s:19:\"2018-10-12 10:42:10\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_25d48b262650ffbed218efbd3a765\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"2702\";s:7:\"updated\";s:19:\"2020-10-21 14:43:28\";s:7:\"created\";s:19:\"2018-10-11 20:43:04\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}i:6;O:9:\"FS_Plugin\":23:{s:16:\"parent_plugin_id\";s:4:\"1296\";s:5:\"title\";s:13:\"WPHR Training\";s:4:\"slug\";s:13:\"wphr-training\";s:12:\"premium_slug\";s:21:\"wphr-training-premium\";s:4:\"type\";s:6:\"plugin\";s:20:\"affiliate_moderation\";N;s:19:\"is_wp_org_compliant\";b:1;s:22:\"premium_releases_count\";i:5;s:4:\"file\";N;s:7:\"version\";N;s:11:\"auto_update\";N;s:4:\"info\";O:14:\"FS_Plugin_Info\":13:{s:9:\"plugin_id\";s:4:\"3818\";s:11:\"description\";s:303:\"This addon helps you assign training resources such as videos and documents to employees.  You can also check they read/watched the resource (great for compliance) and check their level of understanding with a simple test.  Employees can be asked to retake the test if they don\'t achieve a minimum mark.\";s:17:\"short_description\";N;s:10:\"banner_url\";s:61:\"//s3-us-west-2.amazonaws.com/freemius/plugins/3818/banner.png\";s:15:\"card_banner_url\";s:66:\"//s3-us-west-2.amazonaws.com/freemius/plugins/3818/card_banner.png\";s:15:\"selling_point_0\";s:92:\"Add training videos or documents to employee profiles.  Bulk assign by job type or location.\";s:15:\"selling_point_1\";s:54:\"Set simple test to ensure understanding and compliance\";s:15:\"selling_point_2\";s:60:\"Get notified that employees have reviewed training materials\";s:11:\"screenshots\";N;s:2:\"id\";s:3:\"894\";s:7:\"updated\";s:19:\"2019-08-12 12:23:20\";s:7:\"created\";s:19:\"2019-06-25 15:47:19\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}s:10:\"is_premium\";b:0;s:14:\"premium_suffix\";s:9:\"(Premium)\";s:7:\"is_live\";b:1;s:9:\"bundle_id\";N;s:17:\"bundle_public_key\";N;s:10:\"public_key\";s:32:\"pk_b236370bb41af077964c77ec3341b\";s:10:\"secret_key\";N;s:2:\"id\";s:4:\"3818\";s:7:\"updated\";s:19:\"2020-10-27 20:56:36\";s:7:\"created\";s:19:\"2019-05-16 16:18:55\";s:22:\"\0FS_Entity\0_is_updated\";b:0;}}}s:23:\"user_id_license_ids_map\";a:1:{i:1296;a:1:{i:3863876;a:0:{}}}s:12:\"all_licenses\";a:1:{i:1296;a:0:{}}s:7:\"updates\";a:1:{i:1296;N;}}', 'yes'),
