(1415, 'wphr_settings_wphr-crm_subscription', 'a:8:{s:10:\"is_enabled\";s:3:\"yes\";s:13:\"email_subject\";s:34:\"Confirma tu suscripción a Elefont\";s:13:\"email_content\";s:270:\"Hello!\n\nThanks so much for signing up for our newsletter.\nWe need you to activate your subscription to the list(s): [contact_groups_to_confirm] by clicking the link below: \n\n[activation_link]Click here to confirm your subscription.[/activation_link]\n\nThank you,\n\nElefont\";s:7:\"page_id\";i:188;s:18:\"confirm_page_title\";s:21:\"¡Ya estás suscrito!\";s:20:\"confirm_page_content\";s:79:\"Te hemos añadido a nuestra lista de correo. Tendrás noticias nuestras pronto.\";s:17:\"unsubs_page_title\";s:22:\"Ya estás dado de baja\";s:19:\"unsubs_page_content\";s:49:\"Te has dado de baja con éxito de la(s) lista(s):\";}', 'yes'),
(1416, 'wphr_email_settings_employee-welcome', 'a:3:{s:7:\"subject\";s:37:\"Welcome {full_name} to {company_name}\";s:7:\"heading\";s:29:\"Welcome Onboard {first_name}!\";s:4:\"body\";s:1029:\"Dear {full_name},\r\n\r\nWelcome aboard as a <strong>{job_title}</strong> in our <strong>{dept_title}</strong> team at <strong>{company_name}</strong>! I am pleased to have you working with us. You were selected for employment due to the attributes that you displayed that appear to match the qualities I look for in an employee.\r\n\r\nI’m looking forward to seeing you grow and develop into an outstanding employee that exhibits a high level of care, concern, and compassion for others. I hope that you will find your work to be rewarding, challenging, and meaningful.\r\n\r\nYour <strong>{type}</strong> employment will start from <strong>{joined_date}</strong> and you will be reporting to <strong>{reporting_to}</strong>.\r\n\r\nPlease take your time and review our yearly goals so that you can know what is expected and make a positive contribution. Again, I look forward to seeing you grow as a professional while enhancing the lives of the clients entrusted in your care.\r\n\r\nSincerely,\r\nManager Name\r\nCEO, Company Name\r\n\r\n{login_info}\";}', 'yes'),
(1417, 'wphr_email_settings_new-leave-request', 'a:3:{s:7:\"subject\";s:47:\"New leave request received from {employee_name}\";s:7:\"heading\";s:17:\"New Leave Request\";s:4:\"body\";s:333:\"Hello,\r\n\r\nA new leave request has been received from {employee_url}.\r\n\r\n<strong>Leave type:</strong> {leave_type}\r\n<strong>Date:</strong> {date_from} to {date_to}\r\n<strong>Duration:</strong> {no_days}\r\n<strong>Reason:</strong> {reason}\r\n\r\nPlease approve/reject this leave application by going following:\r\n\r\n{requests_url}\r\n\r\nThanks.\";}', 'yes'),
(1418, 'wphr_email_settings_approved-leave-request', 'a:3:{s:7:\"subject\";s:36:\"Your leave request has been approved\";s:7:\"heading\";s:22:\"Leave Request Approved\";s:4:\"body\";s:193:\"Hello {employee_name},\r\n\r\nYour <strong>{leave_type}</strong> type leave request for <strong>{no_days}</strong> from {date_from} to {date_to} has been approved.\r\n\r\nRegards\r\nManager Name\r\nCompany\";}', 'yes'),
(1419, 'wphr_email_settings_rejected-leave-request', 'a:3:{s:7:\"subject\";s:36:\"Your leave request has been rejected\";s:7:\"heading\";s:22:\"Leave Request Rejected\";s:4:\"body\";s:240:\"Hello {employee_name},\r\n\r\nYour <strong>{leave_type}</strong> type leave request for <strong>{no_days}</strong> from {date_from} to {date_to} has been rejected.\r\n\r\nThe reason of rejection is: {reject_reason}\r\n\r\nRegards\r\nManager Name\r\nCompany\";}', 'yes'),
(1420, 'wphr_email_settings_new-task-assigned', 'a:3:{s:7:\"subject\";s:33:\"New task has been assigned to you\";s:7:\"heading\";s:17:\"New Task Assigned\";s:4:\"body\";s:164:\"Hello {employee_name},\r\n\r\nA new task <strong>{task_title}</strong> has been assigned to you by {created_by}.\r\nDue Date: {due_date}\r\n\r\nRegards\r\nManager Name\r\nCompany\";}', 'yes'),
