(829, 266, '_form', '<label> Nombre\n    [text* your-name] </label>\n\n<label> Email\n    [email* your-email] </label>\n\n<label> Fecha\n    [date Fechayhora] </label>\n\n<label> Medio de transporte\n    [select Mediodetransporte include_blank \"Coche\" \"Bus\" \"Tren\" \"Metro\" \"Bici\"] </label>\n\n<label> Distancia recorrida (km)\n    [number Distancia min:0 max:100 \"0\"] </label>\n\n<label> Peaje\n    [text Peaje] </label>\n<label>\n    [file ticket limit:4000000000] </label>\n\n<label> Parking\n    [text Parking] </label>\n<label>\n    [file ticket limit:4000000000] </label>\n\n<label> Mensaje\n    [textarea your-message] </label>\n\n[submit \"Enviar\"]'),
(830, 266, '_mail', 'a:9:{s:6:\"active\";b:1;s:7:\"subject\";s:23:\"[textarea your-message]\";s:6:\"sender\";s:38:\"[your-email] <wordpress@10.122.27.136>\";s:9:\"recipient\";s:26:\"nuria.ovejero@maristak.net\";s:4:\"body\";s:201:\"De: [your-name] <[your-email]>\nFecha: [Fechayhora]\n\nMedio de transporte: [Mediodetransporte]\nDistancia recorrida: [Distancia]\nPeaje: [Peaje]\n[ticket]\nParking: [Parking]\n[ticket]\nMensaje: [your-message]\";s:18:\"additional_headers\";s:22:\"Reply-To: [your-email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
(831, 266, '_mail_2', 'a:9:{s:6:\"active\";b:0;s:7:\"subject\";s:32:\"[_site_title] «[your-subject]»\";s:6:\"sender\";s:39:\"[_site_title] <wordpress@10.122.27.136>\";s:9:\"recipient\";s:12:\"[your-email]\";s:4:\"body\";s:153:\"Cuerpo del mensaje:\n[your-message]\n[your-name]\n[Fechayhora]\n-- \nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\";s:18:\"additional_headers\";s:29:\"Reply-To: [_site_admin_email]\";s:11:\"attachments\";s:0:\"\";s:8:\"use_html\";b:0;s:13:\"exclude_blank\";b:0;}'),
