(264, 1, '2020-11-03 08:05:32', '2020-11-03 08:05:32', '<!-- wp:html -->\n<html>\n<head><title>lista</title></head>\n<body>\n<?php\n$con= mysqli_connect (\"localhost\",\"elefont\",\"grupo3\",\"grupo3\") or die (\"error al conectar\");\n$sql= \"select * from gastos\";\n$result= mysqli_query ($con,$sql);\nif (!result) {\n    $error= mysqli_error($con);\n    echo $error;\n\n}else{\n\n?>\n<table>\n<tr>\n<th>id</th>\n<th>nombre</th>\n<th>edad</th>\n</tr>\n<?php\nwhile ($row=mysqli_fetch_assoc($result)){\n    extract($row)\n?>\n<tr>\n<td><?php echo $id_gastos; ?></td>\n<td><?php echo $fecha_hora; ?></td>\n<td><?php echo $transporte; ?></td>\n<td><?php echo $distancia; ?></td>\n<td><?php echo $peaje; ?></td>\n<td><?php echo $parking; ?></td>\n<td><?php echo $dieta; ?></td>\n<td><?php echo $; ?></td>\n</tr>\n<?php\n}\n?>\n</table>\n<?php\n}\n?>\n</body>\n</html>\n<!-- /wp:html -->\n\n<!-- wp:table -->\n<figure class=\"wp-block-table\"><table><tbody><tr><td><br>[xyz-ips snippet=\"gestion-gastos\"]<br></td></tr></tbody></table></figure>\n<!-- /wp:table -->', 'Gastos', '', 'inherit', 'closed', 'closed', '', '120-revision-v1', '', '', '2020-11-03 08:05:32', '2020-11-03 08:05:32', '', 120, 'http://10.122.27.136/wordpress/index.php/2020/11/03/120-revision-v1/', 0, 'revision', '', 0),
