INSERT INTO `wp_snippets` (`id`, `name`, `description`, `code`, `tags`, `scope`, `priority`, `active`, `modified`) VALUES
(1, 'Ejemplo de shortcode HTML', 'Este es un fragmento de código de ejemplo para demostrar cómo añadir a tu web un shortcode HTML.\n\nPuedes eliminarlo o editarlo para añadir tu propio contenido.', '\nadd_shortcode( \'shortcode_name\', function () {\n\n	$out = \'<p>teclea aquí el contenido de tu shortcode HTML</p>\';\n\n	return $out;\n} );', 'shortcode', 'global', 10, 0, '2020-10-25 12:48:33'),
(2, 'Ejemplo de fragmento de código para CSS', 'Este es un fragmento de código de ejemplo para demostrar cómo añadir a tu web código CSS personalizado.\n\nPuedes eliminarlo o editarlo para añadir tu propio contenido.', '\nadd_action( \'wp_head\', function () { ?>\n<style>\n\n	/* escribe aquí tu código CSS */\n\n</style>\n<?php } );\n', 'css', 'front-end', 10, 0, '2020-10-25 12:48:33'),
(3, 'Ejemplo de fragmento de código para JavaScript', 'Este es un fragmento de código de ejemplo para demostrar cómo añadir a tu web código JavaScript personalizado.\n\nPuedes eliminarlo o editarlo para añadir tu propio contenido.', '\nadd_action( \'wp_head\', function () { ?>\n<script>\n\n	/* escribe aquí tu código JavaScript */\n\n</script>\n<?php } );\n', 'javascript', 'front-end', 10, 0, '2020-10-25 12:48:33'),
(4, 'Ordenar los fragmentos de código por nombre', 'Por defecto, ordena los fragmentos de código por nombre en la tabla de fragmentos de código.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'name\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2020-10-25 12:48:33'),
(5, 'Ordenar los fragmentos de código por fecha', 'Ordenar por defecto los fragmentos de código por la fecha de última modificación en la tabla de fragmentos de código.', '\nadd_filter( \'code_snippets/list_table/default_orderby\', function () {\n	return \'modified\';\n} );\n\nadd_filter( \'code_snippets/list_table/default_order\', function () {\n	return \'desc\';\n} );\n', 'code-snippets-plugin', 'admin', 10, 0, '2020-10-25 12:48:33'),
(6, 'conexion', '', '$hostname_strcn = \"localhost\";//\"127.0.0.1\";\r\n$database_strcn = \"elefont\";\r\n$username_strcn = \"grupo3\";\r\n$password_strcn = \"grupo3\";\r\nmysql_connect($hostname_strcn, $username_strcn, $password_strcn) or die(mysql_error());\r\nmysql_select_db($database_strcn) or die(mysql_error());', '', 'front-end', 10, 0, '2020-10-25 12:52:12');
