INSERT INTO `wp_xyz_ips_short_code` (`id`, `title`, `content`, `short_code`, `status`) VALUES
(1, 'Historico', '<html>\r\n<head>\r\n<title>Buqueda</title>\r\n</head>\r\n<body>\r\n<?php\r\n$user_id = get_current_user_id();\r\n?>\r\n<form name=\"form_buscar\" method=\"post\" action=\"<?php echo $_SERVER[\'PHP_SELF\']; ?>\" >\r\n  <h1>Búsqueda por Fecha</h1>\r\n    <label>Fecha comienzo: <br/>\r\n    <input type=\"date\" id=\"start_date\" name=\"start_date\"  placeholder=\"yyyy/mm/dd\"></label> <br/>\r\n    <label>Fecha final:<br/>\r\n    <input type=\"date\" id=\"end_date\" name=\"end_date\"  placeholder=\"yyyy/mm/dd\"></label><br/>\r\n    <input type=\"hidden\" id=\"form_sent\" name=\"form_sent\" value=\"true\">\r\n     <label>Importe 1:<br/>\r\n    <input type=\"number\" id=\"importe1\" name=\"importe1\"> <br/></label>\r\n    <label> Importe 2:<br/>\r\n    <input type=\"number\" id=\"importe2\" name=\"importe2\"><br/></label>\r\n    <input type=\"hidden\" id=\"form_sent\" name=\"form_sent\" value=\"true\"></br>\r\n    <input type=\"submit\" name=\"buscador\" value=\"Buscar\" />\r\n</form>\r\n</br>\r\n<?php\r\n	if(!isset($_POST[\'buscador\'])){\r\n    $con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n    or die(\"No se ha podido conectar a la BD\");\r\nif ($user_id == 1){\r\n$sql = \"select * from dietas\";\r\n     } else {\r\n    $sql = \"select * from dietas where ID like \'$user_id\'\";\r\n    };\r\n$result = mysqli_query($con, $sql);\r\n    if (!$result) {\r\n        $error = mysqli_error($con);\r\n        echo \"ERROR: $error\";\r\n    } else {\r\n        ?>\r\n<table border=\"1\">\r\n    <tr>\r\n    	<th>Ciudad</th>\r\n    	<th>Fecha_inicio</th>\r\n    	<th>Fecha_fin</th>\r\n    	<th>Gastos</th>\r\n    	<th>Medio de transporte</th>\r\n    	<th>Peaje</th>\r\n        <th>Parking</th>\r\n    	<th>Ticket</th>\r\n		<th>Depto.</th>\r\n		<th>Proyecto</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n    	<td><?php echo $ciudad; ?></td> \r\n    	<td><?php echo $fecha_inicio; ?></td>\r\n    	<td><?php echo $fecha_fin; ?></td>\r\n    	<td><?php echo $gastos; ?></td>\r\n        <td><?php echo $medio_transporte; ?></td>\r\n    	<td><?php echo $peaje; ?></td>\r\n        <td><?php echo $parking; ?></td>\r\n        <td><?php echo $ticket; ?></td>\r\n		<td><?php echo $codigo_departamento; ?></td>\r\n		<td><?php echo $codigo_proyecto; ?></td>\r\n    </tr>\r\n    <?php\r\n    }\r\n    ?>\r\n</table>\r\n    <?php \r\n    }}if(isset($_POST[\'buscador\'])) {\r\n		\r\n		\r\n        $fecha_inicio=$_POST[\'start_date\'];\r\n        $fecha_fin=$_POST[\'end_date\'];\r\n        $importe1=$_POST[\'importe1\'];\r\n        $importe2=$_POST[\'importe2\'];\r\n		//SI SE QUIERE BUSCAR MEDIANTE IMPORTE Y FECHA A LA VEZ\r\n		\r\n				if(!empty($importe1)&&(!empty($importe2))&&(!empty($fecha_fin))&&(!empty($fecha_inicio))){\r\n				$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n				or die(\"No se ha podido conectar a la BD\");\r\n                                if ($user_id  == 1) {\r\n			        $sql = \"select * from dietas where gastos between \'$importe1\' and \'$importe2\' AND fecha_inicio and fecha_fin between \'$fecha_inicio\' and \'$fecha_fin\' order by fecha_inicio desc\";\r\n                                } else {\r\n                                $sql = \"select * from dietas where gastos between \'$importe1\' and \'$importe2\' AND fecha_inicio and fecha_fin between \'$fecha_inicio\' and \'$fecha_fin\' and ID like \'$user_id\' order by fecha_inicio desc\";\r\n};\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n    ?>\r\n    <table border=\"1\">\r\n    <tr>\r\n    	  	<th>Ciudad</th>\r\n    	<th>Fecha_inicio</th>\r\n    	<th>Fecha_fin</th>\r\n    	<th>Gastos</th>\r\n    	<th>Medio de transporte</th>\r\n    	<th>Peaje</th>\r\n        <th>Parking</th>\r\n    	<th>Ticket</th>\r\n		<th>Depto.</th>\r\n		<th>Proyecto</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n    	    	<td><?php echo $ciudad; ?></td> \r\n    	<td><?php echo $fecha_inicio; ?></td>\r\n    	<td><?php echo $fecha_fin; ?></td>\r\n    	<td><?php echo $gastos; ?></td>\r\n        <td><?php echo $medio_transporte; ?></td>\r\n    	<td><?php echo $peaje; ?></td>\r\n        <td><?php echo $parking; ?></td>\r\n        <td><?php echo $ticket; ?></td>\r\n		<td><?php echo $codigo_departamento; ?></td>\r\n		<td><?php echo $codigo_proyecto; ?></td>\r\n    </tr>\r\n\r\n<?php \r\n    } ?>\r\n</table>\r\n<?php\r\n		//IMPORTE FORM\r\n		\r\n	}else if(!empty($importe1)&&(!empty($importe2))){\r\n				$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n				or die(\"No se ha podido conectar a la BD\");\r\n                                 if ($user_id  == 1) {\r\n                                 $sql = \"select * from dietas where gastos between \'$importe1\' and \'$importe2\' order by fecha_inicio desc\";\r\n                                 } else {\r\n				$sql = \"select * from dietas where gastos between \'$importe1\' and \'$importe2\' and ID like \'$user_id\' order by fecha_inicio desc\";\r\n                               };\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n   \r\n    ?>\r\n    <table border=\"1\">\r\n    <tr>\r\n    	  	<th>Ciudad</th>\r\n    	<th>Fecha_inicio</th>\r\n    	<th>Fecha_fin</th>\r\n    	<th>Gastos</th>\r\n    	<th>Medio de transporte</th>\r\n    	<th>Peaje</th>\r\n        <th>Parking</th>\r\n    	<th>Ticket</th>\r\n		<th>Depto.</th>\r\n		<th>Proyecto</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n    	    	<td><?php echo $ciudad; ?></td> \r\n    	<td><?php echo $fecha_inicio; ?></td>\r\n    	<td><?php echo $fecha_fin; ?></td>\r\n    	<td><?php echo $gastos; ?></td>\r\n        <td><?php echo $medio_transporte; ?></td>\r\n    	<td><?php echo $peaje; ?></td>\r\n        <td><?php echo $parking; ?></td>\r\n        <td><?php echo $ticket; ?></td>\r\n		<td><?php echo $codigo_departamento; ?></td>\r\n		<td><?php echo $codigo_proyecto; ?></td>\r\n    </tr>\r\n\r\n<?php \r\n    } ?>\r\n</table>\r\n<?php\r\n\r\n// FECHA FORM\r\n\r\n    }else if(!empty($fecha_inicio)&&(!empty($fecha_fin))){\r\n					$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")  \r\n				or die(\"No se ha podido conectar a la BD\");\r\n                           if ($user_id  == 1) {\r\n$sql = \"select * from dietas where fecha_inicio and fecha_fin between \'$fecha_inicio\' and \'$fecha_fin\' order by fecha_inicio desc \";\r\n                           } else {\r\n				$sql = \"select * from dietas where fecha_inicio and fecha_fin between \'$fecha_inicio\' and \'$fecha_fin\' and ID like \'$user_id\' order by fecha_inicio desc \";\r\n                            };\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n   \r\n    ?>\r\n    <table border=\"1\">\r\n    <tr>\r\n    	  	<th>Ciudad</th>\r\n    	<th>Fecha_inicio</th>\r\n    	<th>Fecha_fin</th>\r\n    	<th>Gastos</th>\r\n    	<th>Medio de transporte</th>\r\n    	<th>Peaje</th>\r\n        <th>Parking</th>\r\n    	<th>Ticket</th>\r\n		<th>Depto.</th>\r\n		<th>Proyecto</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n    	    	<td><?php echo $ciudad; ?></td> \r\n    	<td><?php echo $fecha_inicio; ?></td>\r\n    	<td><?php echo $fecha_fin; ?></td>\r\n    	<td><?php echo $gastos; ?></td>\r\n        <td><?php echo $medio_transporte; ?></td>\r\n    	<td><?php echo $peaje; ?></td>\r\n        <td><?php echo $parking; ?></td>\r\n        <td><?php echo $ticket; ?></td>\r\n		<td><?php echo $codigo_departamento; ?></td>\r\n		<td><?php echo $codigo_proyecto; ?></td>\r\n    </tr>\r\n\r\n<?php \r\n    } ?>\r\n</table>\r\n	<?php }}\r\n    \r\n	\r\n?>                                                                      \r\n</body>\r\n</html>', '[xyz-ips snippet=\"Historico\"]', 1),
(2, 'Gestion-de-proyectos-y-horas', '<html>\r\n<body>\r\n<?php\r\n$user_id = get_current_user_id();\r\n?>\r\n<form method=\"post\" name=\"gestion\" action=\"<?php echo $_SERVER[\'PHP_SELF\']; ?>\">\r\n<table border=\"1\">\r\n<tr>\r\n	<th>\r\n	Nombre del proyecto\r\n	</th>\r\n	<th>\r\n		Lunes\r\n	</th>\r\n	<th>\r\n		Martes\r\n	</th>\r\n	<th>\r\n		Miercoles\r\n	</th>\r\n	<th>\r\n		Jueves\r\n	</th>\r\n	<th>\r\n		Viernes\r\n	</th>\r\n</tr>\r\n<tr>\r\n	<td> <input name=\"nombre_proyecto1\" type=\"text\" placeholder=\"\"/> </td>\r\n	<td> <input name=\"lunes1\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"martes1\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"miercoles1\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"jueves1\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"viernes1\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n</tr>\r\n<tr>\r\n	<td> <input name=\"nombre_proyecto2\" type=\"text\" placeholder=\"\"/> </td>\r\n	<td> <input name=\"lunes2\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"martes2\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"miercoles2\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"jueves2\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"viernes2\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n</tr>\r\n<tr>\r\n	<td> <input name=\"nombre_proyecto3\" type=\"text\" placeholder=\"\"/> </td>\r\n	<td> <input name=\"lunes3\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"martes3\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"miercoles3\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"jueves3\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"viernes3\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n</tr>\r\n<tr>\r\n	<td> <input name=\"nombre_proyecto4\" type=\"text\" placeholder=\"\"/> </td>\r\n	<td> <input name=\"lunes4\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"martes4\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"miercoles4\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"jueves4\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	<td> <input name=\"viernes4\" type=\"number\" min=\"0\" max=\"24\" value=\"0\"/> </td>\r\n	\r\n</tr>\r\n\r\n</table>\r\n       <label>\r\n	<input name=\"codigo_proyecto1\" placeholder=\"Codigo de proyecto\" type=\"text\"/>      </label>   \r\n	 <label>\r\n	<input  name=\"codigo_departamento1\"  placeholder=\"Codigo de departamento\" type=\"text\"/>  </label></br>\r\n        <label><p>Introduce la fecha de ingreso</p>\r\n	<input required=\"required\" name=\"fecha1\" type=\"date\"/>  </label>\r\n<input type=\"submit\" value=\"Guardar\" name=\"guardar\" />\r\n</form>\r\n</body>\r\n<?php\r\nif(isset($_POST[\'guardar\'])){\r\n	$codigo_proyecto1=$_POST[\'codigo_proyecto1\'];\r\n	$codigo_departamento1=$_POST[\'codigo_departamento1\'];\r\n	$nombre_proyecto1=$_POST[\'nombre_proyecto1\'];\r\n	$lunes1=$_POST[\'lunes1\'];\r\n	$martes1=$_POST[\'martes1\'];\r\n	$miercoles1=$_POST[\'miercoles1\'];\r\n	$jueves1=$_POST[\'jueves1\'];\r\n	$viernes1=$_POST[\'viernes1\'];\r\n\r\n	$fecha1=$_POST[\'fecha1\'];\r\n	\r\n	$nombre_proyecto2=$_POST[\'nombre_proyecto2\'];\r\n	$lunes2=$_POST[\'lunes2\'];\r\n	$martes2=$_POST[\'martes2\'];\r\n	$miercoles2=$_POST[\'miercoles2\'];\r\n	$jueves2=$_POST[\'jueves2\'];\r\n	$viernes2=$_POST[\'viernes2\'];\r\n	\r\n	$nombre_proyecto3=$_POST[\'nombre_proyecto3\'];\r\n	$lunes3=$_POST[\'lunes3\'];\r\n	$martes3=$_POST[\'martes3\'];\r\n	$miercoles3=$_POST[\'miercoles3\'];\r\n	$jueves3=$_POST[\'jueves3\'];\r\n	$viernes3=$_POST[\'viernes3\'];\r\n	\r\n	$nombre_proyecto4=$_POST[\'nombre_proyecto4\'];\r\n	$lunes4=$_POST[\'lunes4\'];\r\n	$martes4=$_POST[\'martes4\'];\r\n	$miercoles4=$_POST[\'miercoles4\'];\r\n	$jueves4=$_POST[\'jueves4\'];\r\n	$viernes4=$_POST[\'viernes4\'];\r\n\r\n	\r\n\r\n	$suma1=$lunes1+$martes1+$miercoles1+$jueves1+$viernes1;\r\n	$suma2=$lunes2+$martes2+$miercoles2+$jueves2+$viernes2;\r\n	$suma3=$lunes3+$martes3+$miercoles3+$jueves3+$viernes3;\r\n	$suma4=$lunes4+$martes4+$miercoles4+$jueves4+$viernes4;\r\n	\r\n	if($suma1>0){\r\n		$con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")or die(\"no se ha conectado a la base de datos\");\r\n		$result=mysqli_query($con,\"insert into gestion (ID,horas, codigo_departamento, codigo_proyecto, fecha, nombre_proyecto) values (\'$user_id\', \'$suma1\', \'$codigo_departamento1\', \'$codigo_proyecto1\',\'$fecha1\',\'$nombre_proyecto1\') \");\r\nif(!$result){\r\n	$error=mysqli_error($con);\r\n	echo \"$error\";\r\n} \r\n	}\r\n	\r\n	if($suma2>0){\r\n		$con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")or die(\"no se ha conectado a la base de datos\");\r\n		$result=mysqli_query($con,\"insert into gestion (ID, horas, codigo_departamento, codigo_proyecto, fecha, nombre_proyecto) values (\'$user_id\',\'$suma2\', \'$codigo_departamento1\', \'$codigo_proyecto1\',\'$fecha1\',\'$nombre_proyecto2\') \");\r\nif(!$result){\r\n	$error=mysqli_error($con);\r\n	echo \"$error\";\r\n} \r\n	}\r\n	\r\n	if($suma3>0){\r\n		$con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")or die(\"no se ha conectado a la base de datos\");\r\n		$result=mysqli_query($con,\"insert into gestion (ID, horas, codigo_departamento, codigo_proyecto, fecha, nombre_proyecto) values (\'$user_id\', \'$suma3\', \'$codigo_departamento1\', \'$codigo_proyecto1\',\'$fecha1\',\'$nombre_proyecto3\') \");\r\nif(!$result){\r\n	$error=mysqli_error($con);\r\n	echo \"$error\";\r\n} \r\n	}\r\n	\r\n	if($suma4>0){\r\n		$con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")or die(\"no se ha conectado a la base de datos\");\r\n		$result=mysqli_query($con,\"insert into gestion (ID, horas, codigo_departamento, codigo_proyecto, fecha, nombre_proyecto) values (\'$user_id\', \'$suma4\', \'$codigo_departamento1\', \'$codigo_proyecto1\',\'$fecha1\',\'$nombre_proyecto4\') \");\r\nif(!$result){\r\n	$error=mysqli_error($con);\r\n	echo \"$error\";\r\n} else{\r\necho \"Datos bien introducidos\";\r\n}\r\n	}\r\n	\r\n\r\n	\r\n\r\n}\r\n\r\n?>\r\n</html>', '[xyz-ips snippet=\"Gestion-de-proyectos-y-horas\"]', 1),
(3, 'Gastos-fuera-de-casa', '<!--Título-->\r\n<style>\r\nlabel { display: inline-block; width: 210px; text-align: left; }\r\n</style>\r\n<p><H2>Gestión de gastos</H2></p>\r\n</br>\r\n<!--Formulario-->\r\n<?php\r\n$user_id = get_current_user_id();\r\n?>\r\n<FORM id=\"contacto\" name=\"contacto\" action=\"<?php echo $_SERVER[\'PHP_SELF\']; ?>\" method=\"POST\">\r\n\r\n\r\n<select name=\"continente\" size=1 \"> \r\n            <option selected=\"true\" disabled=\"disabled\" value=\"\">Seleccione Continente\r\n			<option value=\"Europa\">Europa\r\n			<option value=\"Asia\">Asia\r\n			<option value=\"Africa\">Africa\r\n			<option value=\"America_del_norte\">America del norte\r\n			<option value=\"America_del_sur\">America del sur\r\n			<option value=\"Oceania\">Oceania\r\n			</select></label>\r\n			\r\n<br/>\r\n\r\n<label>Ciudad\r\n<input name=\"ciudad\" type=\"text\" id=\"ciudad\" size=\"31\"/></label></p>\r\n<br/>\r\n<label>Pais\r\n<input name=\"pais\" type=\"text\" id=\"pais\" size=\"31\"/></label></p>\r\n<br/>\r\n\r\n<label>Codigo Departamento\r\n<input name=\"codigo_departamento\" type=\"text\" id=\"codigo_departamento\" size=\"31\"/></label></p>\r\n<br/>\r\n<label>Codigo Proyecto\r\n<input name=\"codigo_proyecto\" type=\"text\" id=\"codigo_proyecto\" size=\"31\"/></label></p>\r\n<br/>\r\n<label>Fecha inicio\r\n<input type=\"datetime-local\" name=\"fechainicio\"/></label></p>\r\n</p>\r\n<p>\r\n<label>Fecha fin\r\n<input type=\"datetime-local\" name=\"fechafin\"/></label>\r\n</p><br/>\r\n<p><input type=\"submit\" name=\"enviar\" value=\"Enviar\"/></p>\r\n</FORM>\r\n\r\n<?php\r\nif(isset($_POST[\'enviar\'])){\r\n    $continente=$_POST[\'continente\'];\r\n    $pais=$_POST[\'pais\'];\r\n    $ciudad=$_POST[\'ciudad\'];\r\n    $fecha_inicio=$_POST[\'fechainicio\'];\r\n    $fecha_fin=$_POST[\'fechafin\'];\r\n    $codigo_proyecto=$_POST[\'codigo_proyecto\'];\r\n    $codigo_departamento=$_POST[\'codigo_departamento\'];\r\n\r\n\r\n\r\nif ( $fecha_inicio > $fecha_fin) die (\"El valor no es correcto\");{\r\n        $diff = abs(strtotime($fecha_fin) - strtotime($fecha_inicio));\r\n//Estas variables son necesarias para calcular los dias\r\n            $anos = floor(($diff / (365*60*60*24)));\r\n            $meses = floor(($diff - $anos * 365*60*60*24) / (30*60*60*24));\r\n            $dias = floor(($diff - $anos * 365*60*60*24 - $meses*30*60*60*24)/ (60*60*24));\r\nif( $dias < 4 )  die (\"Introduce una fecha mayor a 4 dias\");{\r\n    if( $continente == \'Europa\' ) \r\n{$con_dieta = 60*($dias);\r\n    } \r\nelseif ($con_dieta = 100*($dias)) \r\n{ }\r\n\r\n$con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\")or die(\"no se ha conectado a la base de datos\");\r\n$result=mysqli_query($con,\"INSERT INTO dietas(ID,pais, ciudad, fecha_inicio, fecha_fin, continente, gastos,codigo_departamento,codigo_proyecto) values (\'$user_id\',\'$pais\', \'$ciudad\', \'$fecha_inicio\', \'$fecha_fin\', \'$continente\', \'$con_dieta\',\'$codigo_departamento\',\'$codigo_proyecto\')\");\r\nif(!$result){\r\n    $error=mysqli_error($con);\r\n    echo \"$error\";\r\n} else{\r\n    echo \"Datos introducidos correctamente\";\r\n}\r\n\r\n}\r\n}\r\n}\r\n?>', '[xyz-ips snippet=\"Gastos-fuera-de-casa\"]', 1),
(4, 'Tarjetas', '<html>\r\n<?php\r\n$res = json_decode( file_get_contents(\'http://localhost:4000/infocards/user1/\'), true );\r\n$encrypted = $res;\r\n$clave = \'KeyMustBe16ByteOR24ByteOR32Byte!\';\r\n$decrypted = @openssl_decrypt($encrypted, \'aes-256-ecb\', $clave);\r\n$res = json_decode($decrypted, true);\r\n$lastactive_eur = $res[\'lastactive_eur\'];\r\n$lastactive_int = $res[\'lastactive_int\'];\r\n$card_europe = $res[\'card_europe\'];\r\n$card_international = $res[\'card_international\'];\r\n$current_card = $res[\'current_card\'];\r\n?>\r\n<!--<h1><?php echo $_SERVER[\'PHP_SELF\']; ?></h1>-->\r\n    <form method=\"post\" name=\"tarjetas\" action=\"<?php echo $_SERVER[\'PHP_SELF\']; ?>\">\r\n    Cambiar tarjeta:<input type=\"submit\" name=\"cambiar\" value=\"Activar\"/>\r\n    </form>\r\n	</br>\r\n    <table border=\"1\">\r\n    <tr>\r\n    <th>Ultima vez activado</th>\r\n	<?php\r\n	if($current_card == \'INTERNATIONAL\') {\r\n		?>\r\n    <td><?php echo $lastactive_int;?></td> \r\n	<?php }\r\n	if($current_card == \'EUROPE\') {\r\n		?>\r\n    <td><?php echo $lastactive_eur;?></td> <?php } ?>\r\n    </tr>\r\n    <tr>\r\n    <th>Numero tarjeta</th>\r\n    <?php\r\n	if($current_card == \'INTERNATIONAL\') {\r\n		?>\r\n    <td><?php echo $card_international;?></td> \r\n	<?php }\r\n	if($current_card == \'EUROPE\') {\r\n		?>\r\n    <td><?php echo $card_europe;?></td> <?php } ?>\r\n    </tr>\r\n    <tr>\r\n    <th>Tarjeta actual</th>\r\n    <td><?php echo $current_card;?></td> \r\n    </tr>\r\n    </table>\r\n<?php\r\nif(isset($_POST[\'cambiar\'])) {\r\n    if($current_card == \'INTERNATIONAL\') {\r\n		$res = json_decode( file_get_contents(\'http://localhost:4000/enablecard/user1/EUROPE\'), true );\r\n		header(\"Refresh:0\");\r\n		}\r\n		}\r\n    if(isset($_POST[\'cambiar\'])) {    \r\n    if($current_card == \'EUROPE\') {\r\n        $res = json_decode ( file_get_contents (\'http://localhost:4000/enablecard/user1/INTERNATIONAL\'), true);\r\n		header(\"Refresh:0\");\r\n		}\r\n		}\r\n?>\r\n</html>', '[xyz-ips snippet=\"Tarjetas\"]', 1),
(5, 'Buscador-horas', '<html>\r\n<head>\r\n<title>Buqueda</title>\r\n</head>\r\n<body>\r\n<?php\r\n$user_id = get_current_user_id();\r\n?>\r\n<form name=\"form_buscar\" method=\"post\" action=\"<?php echo $_SERVER[\'PHP_SELF\']; ?>\" >\r\n    <input type=\"hidden\" id=\"form_sent\" name=\"form_sent\" value=\"true\">\r\n  <h1>Búsqueda de horas en cada proyecto</h1></br>\r\n    <label>Fecha comienzo: <br/>\r\n    <input type=\"date\" id=\"start_date\" name=\"start_date\"  placeholder=\"yyyy/mm/dd\"> </label><br/>\r\n    <label>Fecha final:<br/>\r\n    <input type=\"date\" id=\"end_date\" name=\"end_date\"  placeholder=\"yyyy/mm/dd\"></label></br><br/>\r\n   <label> <input type=\"text\" placeholder=\"Nombre del proyecto\" name=\"nombre_proyecto\"> </label><br/><br/>\r\n\r\n</p>\r\n    <input type=\"submit\" name=\"buscador\" value=\"Buscar\" />\r\n<br/><br/>\r\n</form>\r\n<?php\r\n	if(!isset($_POST[\'buscador\'])){\r\n    $con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n    or die(\"No se ha podido conectar a la BD\");\r\n	if ($user_id == 1){\r\n            $sql = \"select * from gestion \";\r\n        }else{\r\n            $sql = \"select * from gestion where ID like \'$user_id\'\";\r\n        };\r\n    $result = mysqli_query($con, $sql);\r\n    if (!$result) {\r\n        $error = mysqli_error($con);\r\n        echo \"ERROR: $error\";\r\n    } else {\r\n        ?>\r\n<table border=\"1\">\r\n    <tr><th>Nombre del proyecto</th>\r\n    	<th>Horas</th>\r\n    	<th>Codigo de departamento</th>\r\n		<th>Codigo de proyecto</th>\r\n		<th>Fecha</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n	<td><?php echo $nombre_proyecto; ?></td> \r\n    	<td><?php echo $horas; ?></td>\r\n    	<td><?php echo $codigo_departamento; ?></td> \r\n		<td><?php echo $codigo_proyecto; ?></td> \r\n		<td><?php echo $fecha; ?></td> \r\n		</tr>\r\n    <?php\r\n    }\r\n    ?>\r\n</table>\r\n    <?php \r\n    }}if(isset($_POST[\'buscador\'])) {\r\n\r\n		\r\n        $fecha_inicio=$_POST[\'start_date\'];\r\n        $fecha_fin=$_POST[\'end_date\'];\r\n        $nombre_proyecto=$_POST[\'nombre_proyecto\'];\r\n	\r\n		//SI SE QUIERE BUSCAR MEDIANTE IMPORTE Y FECHA A LA VEZ\r\n		\r\n				if(!empty($nombre_proyecto)&&(!empty($fecha_fin))&&(!empty($fecha_inicio))){\r\n				$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n				or die(\"No se ha podido conectar a la BD\");\r\n				if ($user_id == 1){\r\n            $sql = \"select * from gestion where nombre_proyecto like \'$nombre_proyecto\' AND fecha between \'$fecha_inicio\' and \'$fecha_fin\' order by fecha desc\";\r\n        }else{\r\n            $sql = \"select * from gestion where nombre_proyecto like \'$nombre_proyecto\' AND fecha between \'$fecha_inicio\' and \'$fecha_fin\' and ID like \'$user_id\' order by fecha desc\";\r\n        };\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n    ?>\r\n<table border=\"1\">\r\n    <tr><th>Nombre del proyecto</th>\r\n    	<th>Horas</th>\r\n    	<th>Codigo de departamento</th>\r\n		<th>Codigo de proyecto</th>\r\n		<th>Fecha</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n	<td><?php echo $nombre_proyecto; ?></td> \r\n    	<td><?php echo $horas; ?></td>\r\n    	<td><?php echo $codigo_departamento; ?></td> \r\n		<td><?php echo $codigo_proyecto; ?></td> \r\n		<td><?php echo $fecha; ?></td> \r\n		</tr>\r\n    <?php\r\n    }\r\n    ?>\r\n</table>\r\n<?php\r\n		//IMPORTE FORM\r\n		\r\n	}else if(!empty($nombre_proyecto)){\r\n				$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n				or die(\"No se ha podido conectar a la BD\");\r\n				if ($user_id == 1){\r\n            $sql = \"select * from gestion where nombre_proyecto like \'$nombre_proyecto\' order by fecha desc\";\r\n        }else{\r\n            $sql = \"select * from gestion where nombre_proyecto like \'$nombre_proyecto\' order by fecha desc\";\r\n        };\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n   \r\n    ?>\r\n<table border=\"1\">\r\n    <tr><th>Nombre del proyecto</th>\r\n    	<th>Horas</th>\r\n    	<th>Codigo de departamento</th>\r\n		<th>Codigo de proyecto</th>\r\n		<th>Fecha</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n	<td><?php echo $nombre_proyecto; ?></td> \r\n    	<td><?php echo $horas; ?></td>\r\n    	<td><?php echo $codigo_departamento; ?></td> \r\n		<td><?php echo $codigo_proyecto; ?></td> \r\n		<td><?php echo $fecha; ?></td> \r\n		</tr>\r\n    <?php\r\n    }\r\n    ?>\r\n</table>\r\n<?php\r\n\r\n// FECHA FORM\r\n\r\n    }else if(!empty($fecha_inicio)&&(!empty($fecha_fin))){\r\n				$con = mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") \r\n				or die(\"No se ha podido conectar a la BD\");\r\n				if ($user_id == 1){\r\n            $sql = \"select * from gestion where fecha between \'$fecha_inicio\' and \'$fecha_fin\' order by fecha desc \";\r\n        }else{\r\n            $sql = \"select * from gestion where fecha between \'$fecha_inicio\' and \'$fecha_fin\' and ID like \'$user_id\' order by fecha desc \";\r\n        };\r\n				$result1 = mysqli_query($con, $sql);\r\n			if (!$result1) {\r\n				$error = mysqli_error($con);\r\n				echo \"ERROR: $error\";}\r\n\r\n\r\n   \r\n    ?>\r\n<table border=\"1\">\r\n    <tr><th>Nombre del proyecto</th>\r\n    	<th>Horas</th>\r\n    	<th>Codigo de departamento</th>\r\n		<th>Codigo de proyecto</th>\r\n		<th>Fecha</th>\r\n    </tr>\r\n<?php\r\nwhile ($row = mysqli_fetch_assoc($result1)) { //mientras haya datos...\r\n    extract($row);\r\n?>  \r\n    <tr>\r\n	<td><?php echo $nombre_proyecto; ?></td> \r\n    	<td><?php echo $horas; ?></td>\r\n    	<td><?php echo $codigo_departamento; ?></td> \r\n		<td><?php echo $codigo_proyecto; ?></td> \r\n		<td><?php echo $fecha; ?></td> \r\n		</tr>\r\n    <?php\r\n    }\r\n    ?>\r\n</table>\r\n	<?php }}\r\n    \r\n	\r\n?>                                                                      \r\n</body>\r\n</html>', '[xyz-ips snippet=\"Buscador-horas\"]', 1),
(6, 'Gestion-dietas-y-gastos', '<html> \r\n	<body> \r\n		<div align=\"center\">\r\n	<form name=\"form_gastos\" method=\"post\">\r\n<input type=\"hidden\" name=\"enviado\" value=\"1\"/>\r\n		<h1 align=\"center\">Gastos</h1></br>\r\n        <?php\r\n		$fecha= date(\"Y-m-d H:i:s\");\r\n                $user_id = get_current_user_id();\r\n?> \r\n<p> Transporte: </p>\r\n	 	<select required=\"required\" name=\"transporte\">\r\n	 		<option selected=\"true\" disabled=\"disabled\" value=\"\">- Elige un medio de transporte -</option>\r\n			<option>Coche</option>\r\n			<option>Autobus</option>\r\n			<option>Taxi</option>\r\n			<option>Tren</option>\r\n			<option>Metro</option>\r\n			<option>Bicicleta</option>\r\n			<option>A pie</option>  \r\n		</select><br/>\r\n		<input type=\"submit\" name=\"btn_enviar\" value=\"Seleccionar\"/><br/>\r\n		</form><br/>\r\n		</div>\r\n<?php\r\nif (isset($_POST[\'enviar_coche\'])) {\r\n            $medio_transporte=$_POST[\'coche\'];\r\n            $fecha=$_POST[\'fecha\'];\r\n            $distancia=$_POST[\'distancia\'];\r\n            $peaje=$_POST[\'peaje\'];\r\n            $parking=$_POST[\'parking\'];\r\n			$codigo_departamento=$_POST[\'codigo_departamento\'];\r\n			$codigo_proyecto=$_POST[\'codigo_proyecto\'];\r\n            $otros_conceptos=$_POST[\'otros_conceptos\'];\r\n            $km= ($distancia * 0.3);\r\n            $suma = $km+$peaje+$parking;\r\n            $con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") or die(\"error\");\r\n            $result = mysqli_query($con, \"insert into dietas (ID,gastos,fecha_inicio,medio_transporte,distancia,peaje,parking,otros_conceptos, codigo_departamento, codigo_proyecto) values (\'$user_id\', \'$suma\', \'$fecha\', \'$medio_transporte\', \'$distancia\', \'$peaje\', \'$parking\', \'$otros_conceptos\', \'$codigo_departamento\', \'$codigo_proyecto\')\");\r\n            if (!$result) {\r\n                $error = mysqli_error($con);\r\n                echo \"ERROR: $error\"; \r\n             } else {\r\n                echo \"Datos bien introducidos\";\r\n             } \r\n         \r\n                } else if (isset($_POST[\'enviar_autobus\'])) {\r\n                    $medio_transporte=$_POST[\'autobus\'];\r\n                    $fecha=$_POST[\'fecha\'];\r\n                    $ticket=$_POST[\'ticket\'];\r\n			$codigo_departamento=$_POST[\'codigo_departamento\'];\r\n			$codigo_proyecto=$_POST[\'codigo_proyecto\'];\r\n                    $otros_conceptos=$_POST[\'otros_conceptos\'];\r\n					$suma = $ticket;\r\n                    $con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") or die(\"error\");\r\n                    $result = mysqli_query($con, \"insert into dietas (ID,fecha_inicio,medio_transporte,ticket, otros_conceptos, codigo_departamento,codigo_proyecto,gastos) values (\'$user_id\',\'$fecha\',\'$medio_transporte\',\'$ticket\',\'$otros_conceptos\',\'$codigo_departamento\',\'$codigo_proyecto\',\'$suma\')\");\r\n                    if (!$result) {\r\n                        $error = mysqli_error($con);\r\n                        echo \"ERROR: $error\"; \r\n                     } else {\r\n                        echo \"Datos bien introducidos\";\r\n                     } \r\n                 \r\n                        } else if (isset($_POST[\'enviar_taxi\'])) {\r\n                            $medio_transporte=$_POST[\'taxi\'];\r\n                            $fecha=$_POST[\'fecha\'];\r\n                            $ticket=$_POST[\'ticket\'];\r\n							$codigo_departamento=$_POST[\'codigo_departamento\'];\r\n							$codigo_proyecto=$_POST[\'codigo_proyecto\'];\r\n                            $otros_conceptos=$_POST[\'otros_conceptos\'];\r\n							$suma = $ticket;\r\n                            $con=mysqli_connect(\"localhost\",\"grupo3\",\"grupo3\",\"wordpress\") or die(\"error\");\r\n                            $result = mysqli_query($con, \"insert into dietas (ID,fecha_inicio,medio_transporte,ticket, otros_c